  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:55.122522\",\n\t\"name\": \"alamosa-national-wildlife-refuge-annual-narrative-report-calendar-year-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alamosa
  National Wildlife Refuge outlines Refuge accomplishments during the 1992 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, public participation, and research and investigations. Refuge
  administration is outlined; information about personnel, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, croplands, grazing, haying, pest control, and water rights. The
  wildlife section of the report discusses wildlife diversity, endangered and threatened
  species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
  fisheries resources, scientific collections, animal control, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, trapping, wildlife observation, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, equipment replacement, communication
  systems, computer systems, and energy conservation. Cooperative programs are provided
  at the end. Refuge brochures are attached.\",\n\t\"license_title\": \"License Not
